import Vue from 'vue'
import Router from 'vue-router'
import Login from '@/components/Login'
import Register from '@/components/Register'
import Home from '@/components/Home'
import Bug from '@/views/Bug'
import UseCase from '@/views/UseCase'
import Plan from '@/views/Plan'
import Chart from '@/views/Chart'
Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: 'Login',
      component: Login
    },
    {
      path:'/Bug',
      name:'Bug',
      component:Bug
    },
    {
      path:'/UseCase',
      name:'UseCase',
      component:()=>import('../views/UseCase')
    },
    {
      path:'/Plan',
      name:'Plan',
      component:()=>import('../views/Plan')
    },
    {
      path:'/Chart',
      name:'Chart',
      component:()=>import('../views/Chart')
    },
    {
      path: '/register',
      name: 'Register',
      component: Register
    },
    {
      path:'/home',
      name:'Home',
      component:Home
    },

  ],
  mode: "history"
})
